private int d50=10;
private int d20=10;
private int d10=10;

public BaseAtm() {
	// TODO Auto-generated constructor stub
}

public int getD100() {
	return d100;
}

public void setD100(int d100) {
	this.d100 = d100;
}

public int getD50() {
	return d50;
}

public void setD50(int d50) {
	this.d50 = d50;
}

